import React from "react";
import { IonSlides, IonSlide, IonCardTitle } from "@ionic/react";

const SlideShow = () => {
  const slides = [
    {
      id: 0
    },
    {
      id: 1
    },
    {
      id: 2
    },
    {
      id: 3
    },
    {
      id: 4
    }
  ];
  return (
    <IonSlides>
      {slides.map(({ id }) => (
        <IonSlide key={id}>
            <IonCardTitle>{id}</IonCardTitle>
        </IonSlide>
      ))}
    </IonSlides>
  );
};

export default SlideShow;
